    false,nt"url": null,nt"notes": "NCEI Accession 0152497 includes physical,
    profile and underway data collected aboard the MELVILLE during cruise MV1404 in
    the Coastal Waters of SE Alaska and North Pacific Ocean from 2014-06-10 to 2014-06-29.
    These data include CONDUCTIVITY, CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT
    SPEED - NORTH/SOUTH COMPONENT (V), SALINITY and WATER TEMPERATURE. The instruments
    used to collect these data include ADCP, CTD and GPS. These data were collected
    by Uwe Send of University of California - San Diego; Scripps Institution of Oceanography
    as part of Ocean Observatories Initiative (OOI): Station Papa Array, Leg 2. The
    Lamont-Doherty Earth Observatory (LDEO) submitted these data to NCEI as part of
    the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP data represent
    the raw and automated processed data set. Post processed quality assessed data are
